('4d238badba14aac974c299cc86a826d20c7f59af', '2dc01731abc40f5ee27a9a00967a66727da120bf', 'sonali.anand@buniyad.com', NULL, 'completed', '2018-05-14 06:29:39', 'There''s no problem as such but i would like to bring few things in your notice.\r\n\r\nHappy Employees are more productive.\r\n\r\n', 'Personal Grooming Session with Reva Ji- She can take the classes to groom the sales team not only how to be presentable but the body language, and most importantly language. She has capability to drive. Once a week session time 15 min .\r\n\r\nVoice & accent Traning Session with Mazumdar Ji- I have seen him Interacting with the sales team, Working on their communication skills, working on their english skills/basic call or first call training. Once a week session time 15 min.\r\n\r\nVoice & accent Training Session with KAMAL SIR - the kind of persona he has is commendable, sharing his views, experiences with team. No lesson just pure sharing for getting inspired from him ....Work and work unless you get success .....with sales team and back-end. Session time 15 min once a month.\r\n\r\nSession with ABHI SIR - Young mind, diversified perspective...Work hard but party harder attitude...may be am wrong as i didn''t get to know him much but i can foresee this generation believes in equally both things. Balancing skills from him between the both ends. Session time: 15 min once a month\r\n\r\nExperience sharing from BEST EMPLOYEE and BACK-END -session time 10 min once a month\r\n\r\nMotivational Speaker - once a month or once in 2 months ---is really required at all levels to grow.\r\n\r\nFitness/ yoga/ zumba session/ - Fitness is highly important for growth of the company. This is very common aspect these days and specialist are being called in company weekly to have such sessions. Dance/zumba/aerobics make you feel energetic, refreshed and relaxed...session time 15 min to 30 min depends upon time once a month\r\n\r\nPlaying some theme song playing which refreshes your spirit...like Agnee theme song from spiltsvilla or anything can be played in lunch time 1-1.30 soothes mind and wont affect work as the break time. Time duration depends on work can start from one song a day...there are so many options of it...relaxing music/de stress tunes/ music unplugged etc\r\n\r\nThe aspect is to choose people from our own office and learn from them to contribute in company''s growth.\r\n\r\nREMEMBER, HAPPY EMPLOYEES have been shown to be up to 20 percent more effective/productive in the workplace than unhappy employees. \r\n\r\n\r\nThanks\r\n\r\nSonali', '', '', ''),
