('73f80aeca7e85459953fd3875eddafe51f0e86e6', '5561804776b4dfe844f8fc719b7c3ba7241455be', 'sonali.anand@buniyad.com', NULL, 'completed', '2018-06-04 13:31:46', 'Misbehavior at every level. \r\n\r\nI would like to bring this in your notice, that Sales team really has a lot of attitude and replies in very wrong tone. I told them many times directly and to their HOD''s but it is not getting better. Other branches is better than HO as they at least make it argumentative when its work related and are ONE -TO- ONE but at HO, its completely pathetic because they have made a union and made their leaders to talk on behalf of the entire team. \r\n\r\nTo let you know, an hour ago Abhi Sir has called me for telling that he is arranging new ac hence no fans will be ordered now in the office as its spoils office decorum. I conveyed the same message very politely that please whomsoever feels cold please wear the jacket and so that rest of the team who is feeling hot cannot be suffered.\r\n\r\nMr Abhishek Mishra who is the speaker on behalf of all the team always has to put his interest that he doesn''t have the jacket, cannot buy the same or wear and will switch off the ac that too in the very loud tone and whole team will support him . I do not understand the aggressive nature of him and his interrupting nature in everything. I highly disappointed that that due to certain people, the entire team speaks same kind of language. This is management decision what to start and stop and we as employee shall follow the system. In-case of any query, they shall discuss with the concerned person. \r\n\r\nLet me tell you, this kind of attitude leads to union leaders and can harm the company at longer run. As a HR/ADMIN, you shall take such matters seriously and let them know that misbehavior or getting into leadership wont be acceptable.\r\n\r\nI dont have any issues with one person specifically but noticed that if TOP MANAGEMENT TAKE SUCH ISSUES A BIT MORE SERIOUSLY THEY WOULD GET IT RIGHT THAT THEIR ATTITUDE WILL NOT WORK. WE ALL ARE EQUAL AND HERE FOR WORK NOT FOR MAKING GROUPS OR FOR POLITICS.\r\n\r\nDuring my intial days one of the HOD told me, Sonali ji yaha tu ya tum nahi chalega aap bola karo. Since that day i got it for all and made it sure i shall not talk to anyone without saying Ji or aap but just wanted to understand that HAS ANYONE TOLD THE SALES TEAM TO SPEAK POLITELY WITH US / ADMIN/HR OR WHOMSOEVER. ', 'I think first thing is to conduct the etiquette sessions and making it understand 2 rules\r\n\r\n1) BOSS IS ALWAYS RIGHT\r\n2) IF BOSS IS NOT RIGHT, THEN FOLLOW THE RULE 1 \r\nmeans whatever rules or system are being made by company, they are always for your benefit may be not today but at later stage you will realize the same.\r\n\r\nsecondly and foremost thing that they shall be shown mirrors once for all that Company''s make people and vice versa. Its both way hand shake and every role is important in the company. Regarding the revenue generation, sir there are highly educated people who have much better communication skills, presentation skills available at much lower salary than them. Reg the technical knowledge, the company has all the facilities to teach them. If they do not wanna grow please do not hamper the growth of the organisation by spoiling the positivity and indiscipline. \r\n\r\nThird and most important point, the HOD''s has to be trained at the foremost level. The root cause is at their level. \r\n\r\nPlease i have mentioned what i feel and learned in other organisation, apologies if have hurt someone''s unknowingly. \r\n\r\n', '', '', ''),
