('17a47cb5589927585ea481fdda1b6d20765094a9', '61a3d6ca0bba69efb9f1c66bea6b968cc5c17ae6', 'rahul.sharma@buniyad.com', NULL, 'completed', '2018-05-19 06:23:34', 'As discussed with Management and mutual agreed by all employees, i am narrating some issues we are facing relating to HR policy.\r\n1. comp off adjustment time boundation causes burden on employeees and comp off/ working loses.\r\n2. Regularisation intimation we receive after crossing time limits. sometimes we forget to regularise the things being busy in work, and suddenly CRM blocks down. it counts loss of pay.\r\n3. Comp off cant get adjusted to monday/saturday. \r\n4. Third late/early going leads to loss of CL/LOP.\r\n5. Approval from HOD and HR conflicts.', '1. Comp off adjusment can be taken within 30 days of time from the date of sunday working and it should not get lapse in same month/week.\r\n2. Time/ comp off/ on duty/ or any leave regularisation/adjustment can be done at month end not weekly basis. Or pre intimation mail should come to regularise before locks it down.\r\n3. Being in real estate we have to come sunday for sundays and monday is the slowest day as one has to start up their weeks. so mostly they(clients) get busy in mondays. so we request you to allow us to adjust our sundays against mondays.\r\n4. We are working in Delhi/NCR face traffic jam, emergencies or other issues we face. but it is very painful to loose salary on being late. so we suggest you to adjust this third or any ahead late/early going against sunday working(comp off if remains alive).\r\n5. Approval of leaves or any regularisation should be done from a single hand whether from HR or HOD and mail should go to another for keeping nformation.\r\n', '', '', ''),
