('59a36eaca391f8f5cc1050491598f58db75de03d', '7fdf52e283b61432f7f02cbad0b41fd40a38c8b0', 'sonali.anand@buniyad.com', NULL, 'completed', '2018-05-28 05:09:23', 'Washroom hygiene at first floor\r\n\r\nAlso has to be a list of Sunday client visit/ walk ins and invited and attended by whom .... First thing in morning submitted to either of us Mazumdar ji or me for keeping a track. ', 'I noticed on 26 may Saturday, there was a Lady Client who was old and was complaining to his hubby reg the washroom that its not hygienic and have no tissue paper, toilet roll was there. Also there is a paper comes for putting on toilet seat, in shape of toilet cover sheets which is quite economical and much recommended in the company where client do visit with their family and also for females employees hygiene. \r\n\r\nI suggest if we are renovating the conference,can we have modifications in the washroom as well like the second floor washroom... may be that carpet which looks like its not wet anytime or something which gives rich look. ', '', '', ''),
