('a349bdb42d2c88e4d11da4c2efada1e4c5a55095', 'a6b388fad97c2cf51c17b325b6d5ab0462deef27', 'sonali.anand@buniyad.com', NULL, 'completed', '2018-05-07 06:04:46', 'I have been facing the problem of Noise around reception area. I understand that we are into sales and we cannot hamper that but its equally important for us to have peace of mind to work. \r\n\r\nI would not like to name but certain people talk on speakers related to office work and their pitch is really high.\r\n\r\nSales executive has to run outside or towards empty area to better background', '1) Reception Area can be separated, or if not possible may be glass can be extended till the ceiling.  \r\n\r\n 2) There is no as such requirement for 2 people at the same place. One person at Ground level take care of the same duties.\r\n\r\n3) Renovation of conference room can be done in the evening/weekends. \r\n\r\n4) Conference room shall be used (if empty) to speak to clients in order to maintain the decorum.\r\n\r\n5) Pls provide headphones to the team so that they can talk to clients while sitting at their own desk where they have their specifications as well.\r\n\r\n6) Cubicles to be made for sales specially.. not just the table so that they can work more efficiently. thumb board instead o glass in front where they can set their reminders or meetings.\r\n\r\n', '', '', ''),
